# -*- coding: gbk -*-    # 防止出现乱码等格式错误

import execjs
def get_data():
# '123.js'是用来放前面的js的
    with open('123.js','r',encoding='utf-8')as f:
        read_js=f.read()
    return_js = execjs.compile(read_js)
    t = ''
    data = return_js.call('_decodeCont',t)  # 传入参数t进入函数_decondeCont中
    print(data)

if __name__ == '__main__':
    get_data()